Tut_Market_02b:
У рынков есть ряд *параметров рынка*, а именно:
 *ожидаемые характеристики* — характеристики продукта, которые способствуют увеличению объемов его продаж;
 *влияющие недостатки* — недостатки продукта, которые уменьшат объемы продаж, если их сумма превысит определенное значение;
 *недельный спрос* — максимальное количество единиц, которое можно продать за неделю;
 *максимальная цена* — максимальная цена, которую можно запрашивать за продукт на этом рынке.
